-- Structure de la vue `reservation`
--
DROP TABLE IF EXISTS `reservation`;

CREATE ALGORITHM=UNDEFINED DEFINER=`eFreedom`@`localhost` SQL SECURITY DEFINER VIEW `reservation`  AS  select `chambre`.`nomch` AS `nomch`,`reservationch`.`debut` AS `debut`,`reservationch`.`fin` AS `fin`,`reservationch`.`position` AS `position`,`reservationch`.`prenomdemch` AS `prenomdemch`,`reservationch`.`nomdemch` AS `nomdemch`,`reservationch`.`codegrpe` AS `codegrpe`,`reservationch`.`contactdemch` AS `contactdemch`,`reservationch`.`avancerc` AS `avance` from (`reservationch` join `chambre`) where `reservationch`.`numch` = `chambre`.`numch` and `chambre`.`EtatChambre` = 'active' and `reservationch`.`annee` like 2022 and `reservationch`.`mois` like 3 order by `reservationch`.`position` ;
COMMIT;

